La historia de esta bebida se remonta a la década de los años cincuenta del siglo pasado. El propietario del local Giang Café (Vietnam) debía lidiar con la escasez de leche en el país. En este proceso de experimentación tuvo una idea quizás un poco extraña: sustituir el producto lácteo con la parte amarilla del huevo. El resultado fue todo un éxito y hoy en día es un preparado icónico.
Se hace tradicionalmente con yemas, azúcar, leche condensada y café de la especie robusta. Estos granos se caracterizan por su sabor amargo y poca acidez. Esta versión consta de una textura cremosa y olores marcados. Se sirve en una taza dentro de un recipiente con agua caliente para mantener su temperatura constante.
